import React from 'react';
import "./Home.css";

class Home extends React.Component {
  render() {
    return (
    <section className='container'>
      <div className="home__title">
        <h1>#ZEROWASTE</h1>
        <h3>버려진 플라스틱에 새로운 생명을 불어넣은 패션 기업들</h3>
      </div>
    </section>
    );
  };
} 

export default Home;
